import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from './context/context';
import App from './App';
import './index.css';
import { SpeechProvider } from 'react-speech-recognition';

ReactDOM.render(
  <SpeechProvider>
    <Provider>
      <App />
    </Provider>
  </SpeechProvider>,
  document.getElementById('root')
);
